import React, { useState } from 'react'
import {Container} from "react-bootstrap";

function Login() {
    const [open,setOpen]=useState(false)
    const button=()=>{
        setOpen(!open)
    }
    return (
        <div id="login">
            
            <a onClick={button} href="login" className="link1" >
                Log in
              </a>
            {open && (
                <Container>
            <div className="login">
                
                <p>rohithe please wait for a minute</p>
            </div>
            </Container>
            )}
        </div>
    )
}

export default Login
